class Solution(object):
    def missingNumber(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        n = len(nums)
        ap = []
        for i in range(n+1):
        	ap.append(i)
        for i in nums:
        	ap.remove(i)
        return ap[0]
